void build_tree() {
	tree = (unsigned char*)malloc(tree_size);
	is_internal = (unsigned char*)malloc(tree_size);
	memset(is_internal, 1, tree_size);

	unsigned char v;
	unsigned int node = 1;
	unsigned int internal_idx = 0;
	unsigned int leaf_idx = 0;

	for (int i = 0; i < case_size + 2; i++) {
		if (i & 7) {}
		else {
			v = tree_data[i / 8];
		}

		if (offset & v) {
			tree[node] = tree_data[leaf_offset+leaf_idx];
			is_internal[node] = 0;
			leaf_idx++;
			node++;
		}
		else {
			node += ((unsigned short*)(&tree_data[internal_offset]))[internal_idx];
			internal_idx++;
		}
		v <<= 1;
	}
}

void unpack() {
	fd = (unsigned char*)malloc(data_size);
	unsigned char off = 0;
	unsigned char v = 0;
	unsigned int idx = 0;
	for (int i = 0; i < data_size; i++) {
		unsigned int node = 1;
		while (1) {
			if (off == 0) {
				v = packed[idx++];
				off = offset;
			}
			node <<= 1;
			if (off & v)
				node++;

			off >>= 1;
			if (is_internal[node]){}
			else{
				fd[i] = tree[node];
				break;
			}
		}
	}
}

